import React from 'react'
import { NavLink } from 'react-router-dom';

function Home () {
    return <div>
            <div className='image-home'></div>
            <h1>Merci d’avoir participé à cette phase. Nous vous ferons un retour sur les résultats obtenus concernant la performance du prototype. 
                Vos commentaires sont toujours les bienvenues ! Merci de nous contacter sur romain.farel@dgmail.fr 
            </h1>
            <NavLink to="/"><button type="button" className="btn" >-></button></NavLink>
        </div>;
  }

  export default Home
